import React from 'react';
import './main.css';
import Nav from './nav';
import { NavigationProvider } from './navigationContext';

const Main = ({ children, page }) => {
  return (
    <NavigationProvider page={page}>
      <Header />
      <main>{children}</main>
    </NavigationProvider>
  );
};

export default Main;
